class SessionHelper{

    static setAboutSession(JSONDATA){
    
        sessionStorage.setItem("SiteInfoAbout", JSONDATA);
    
    }

    static getAboutSession(){
    
        return sessionStorage.getItem("SiteInfoAbout")
    
    }


}

export default SessionHelper;
